                return {name: ditem[mapping1], value: ditem[mapping2]}
              }
        })
        option.series[findSeriesIndex].symbolSize = (data) => {
          return data[2] / findSeries.scalRatio;
        }
        option.series[findSeriesIndex].data = data
    } else if(type == "api") {
        const { requestType,requestHeader,getParam,postParam,requestUrl,cookie,sources } = item.source.api
        const init = () => {
        $ajax(
            {
            url: sources.baseURL+requestUrl+'?'+getParam,
            type: requestType,
            data: JSON.stringify(postParam),
            headers: JSON.stringify(requestHeader),
            xhrFields: {  withCredentials: cookie },
            success: function (data) {
                // myChart.clear()
                // 过滤器
                if(item.source.filter.isFilter) {
                function filterFn(data, callbackArgs) {
                    item.source.filter.data.code
                }
                data = filterFn(data)
                }
                // 映射
                data = data.map(ditem => {
                    if(findSeries.type == "lines"){
                        const mapping1 = mapping.find(i => i.name == "fromName").mapping
                        const mapping2 = mapping.find(i => i.name == "toName").mapping
                        const mapping3 = mapping.find(i => i.name == "coords").mapping
                        return {fromName: ditem[mapping1], toName: ditem[mapping2], coords: ditem[mapping3]}
                      }
                      else if(findSeries.type == "effectScatter") {
                        const mapping1 = mapping.find(i => i.name == "name").mapping
                        const mapping2 = mapping.find(i => i.name == "value").mapping
                        return {name: ditem[mapping1], value: ditem[mapping2]}
                      } else if (findSeries.type == "map" && findSeries.map.indexOf("-border") == -1) {
                        const mapping1 = mapping.find(i => i.name == "name").mapping
                        const mapping2 = mapping.find(i => i.name == "value").mapping
                        return {name: ditem[mapping1], value: ditem[mapping2]}
                      }
                })
                option.series[findSeriesIndex].symbolSize = (data) => {
                  return data[2] / findSeries.scalRatio;
                }
                option.series[findSeriesIndex].data = data
            }
            }
        )
        }
    }
    }
})
